import React from 'react';
import './App.css';

const PlanDetailsAccount = () => {
    return (
        <div>
            <div>
                <div className="Section Wide">Estimated Pre-Tax Costs Per Pay Period</div>
                <div className="Partition">
                    <span>Employee</span>
                    <span>$230.57</span>
                </div>
            </div>
            <div>
                <div className="Section Wide">Coverage: Employee + Family</div>
            </div>
        </div>
    );
}

export default PlanDetailsAccount;
